import React from 'react';
import Grid from '@material-ui/core/Grid';
import { FILTER_LABELS } from '../../../../shared/constants/stringConstantsSelectors';
import { PRODUCT_TYPE } from '../../../../shared/constants/domainConstantSelectors';
import { SingleSelect } from '../../../common/input/selects/singleSelect';

export const ProductTypeFilter = props => {

    return (
        <Grid item xs={2}>
            <SingleSelect 
                handleFilterChange={props.handleProductType} 
                inputLabel={FILTER_LABELS.PRODUCT_TYPE}
                menuItems={PRODUCT_TYPE}
            />
        </Grid>
    );
};
